import React from "react";

import logoimg from "../../images/logo.svg";

function Landing() {
  return (
    <div id="page-landing">
      <div id="page-landing-content" className="container">
        <div className="logo-container">
          <img src={logoimg} alt="Proffy" />
        </div>
      </div>
    </div>
  );
}
export default Landing;
